[resonance_holder]
[display_status]
[pause_resume]
[exclude_object]
[skew_correction]
[exclude_object]
[gcode_arcs]
[skew_correction]
[virtual_sdcard]
path: ~/printer_data/gcodes

[include macros.cfg]
[include start_stop_gcode.cfg]
[include steppers.cfg]
[include bed_fans.cfg]
[include klicky.cfg]
[include klicky/klicky-probe.cfg]
;[include z_probe.cfg]
;[include adxl.cfg]
[include input_shaper.cfg]
[include test_speed.cfg]
[include brushie.cfg]
[include VGB.cfg]

;[include ercf_hardware.cfg]
;[include ercf_software.cfg]
;[include ercf_parameters.cfg]

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32f446xx_370024001750535556323420-if00

[printer]
kinematics: corexy
max_velocity: 400
max_accel: 19000
max_accel_to_decel: 9500
max_z_velocity: 5
max_z_accel: 350
square_corner_velocity: 5.0

#[z_thermal_adjust]
#min_temp: 20
#max_temp: 80
#sensor_pin: PF5
#sensor_type: Generic 3950
#temp_coeff: -0.0237

[input_shaper]
# Home table, bolted to the wall
shaper_freq_x: 45.6
shaper_type_x: mzv
shaper_freq_y: 48.4
shaper_type_y: mzv

[temperature_sensor Octopus]
sensor_type: temperature_mcu
min_temp: 0
max_temp: 200

[temperature_sensor Chamber]
sensor_pin: PF5
sensor_type: Generic 3950

[temperature_sensor Frame]
sensor_pin: PF4
sensor_type: Generic 3950

[heater_bed]
heater_pin: PA3
sensor_type: Generic 3950
sensor_pin: PF7
max_power: 1.0 # 0.75 # Eurofurence
min_temp: 0
max_temp: 115
pwm_cycle_time: 0.01

[multi_pin controller_fans]
pins: PD14, PD15

[controller_fan controller_fans]
pin: multi_pin:controller_fans
kick_start_time: 0.5
heater: heater_bed
cycle_time: 0.01
fan_speed: 0.15

[led Chamber_LEDs]
white_pin: PD13
cycle_time: 0.00013333

[idle_timeout]
timeout: 1800

[bed_mesh]
algorithm: bicubic
mesh_pps: 2,2
probe_count: 5,5
speed: 400
# fade_start: 0.6
# fade_end: 10.0
zero_reference_position: 325, 325
move_check_distance: 3.0
split_delta_z: .010
fade_start: 1.0 
fade_end: 5.0

[quad_gantry_level]
speed: 400
retries: 10
max_adjust: 10

[heater_fan hotend_fan]
pin: PA8
max_power: 1.0
kick_start_time: 0.5
heater: extruder
heater_temp: 50.0

[fan]
pin: PE5
kick_start_time: 0.25
cycle_time: 0.15
off_below: 0.10

[probe]
z_offset: 5.914

[extruder]
step_pin: PE2
dir_pin: PE3
enable_pin: !PD4
rotation_distance: 4.445
microsteps: 16
full_steps_per_rotation: 200
nozzle_diameter: 0.4
filament_diameter: 1.75
min_temp: 10
max_temp: 300
max_power: 1.0
min_extrude_temp: 190
heater_pin: PA2
sensor_type: ATC Semitec 104GT-2
sensor_pin: PF6
max_extrude_only_distance: 4000
max_extrude_cross_section: 5.0
pressure_advance_smooth_time: 0.03
control: pid
pid_Kp: 26.173
pid_Ki: 1.631
pid_Kd: 105.019

[tmc2209 extruder]
uart_pin: PE1
interpolate: false
run_current: 0.65
sense_resistor: 0.110
stealthchop_threshold: 0

[gcode_shell_command plot_graph]
command: bash /home/tinyfluffs/printer_data/config/scripts/plot_graphs.sh
timeout: 500.0
verbose: True

